gbp(){return"\u039a\u03b9\u03bd\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf \u03ba\u03bf\u03c5\u03bc\u03c0\u03af \u03b5\u03bd\u03b5\u03c1\u03b3\u03b5\u03b9\u03ce\u03bd"},
gk_(){return"\u0388\u03bd\u03b1 \u03ba\u03b9\u03bd\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf \u03ba\u03bf\u03c5\u03bc\u03c0\u03af \u03b5\u03bd\u03b5\u03c1\u03b3\u03b5\u03b9\u03ce\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03bd\u03b1 \u03ba\u03bf\u03c5\u03bc\u03c0\u03af \u03bc\u03b5 \u03ba\u03c5\u03ba\u03bb\u03b9\u03ba\u03cc \u03b5\u03b9\u03ba\u03bf\u03bd\u03af\u03b4\u03b9\u03bf \u03c0\u03bf\u03c5 \u03ba\u03b9\u03bd\u03b5\u03af\u03c4\u03b1\u03b9 \u03c0\u03ac\u03bd\u03c9 \u03b1\u03c0\u03cc \u03c4\u03bf \u03c0\u03b5\u03c1\u03b9\u03b5\u03c7\u03cc\u03bc\u03b5\u03bd\u03bf \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c9\u03b8\u03ae\u03c3\u03b5\u03b9 \u03bc\u03b9\u03b1 \u03ba\u03cd\u03c1\u03b9\u03b1 \u03b5\u03bd\u03ad\u03c1\u03b3\u03b5\u03b9\u03b1 \u03c3\u03c4\u03b7\u03bd \u03b5\u03c6\u03b1\u03c1\u03bc\u03bf\u03b3\u03ae."},
