giM(){return"\u039a\u03ac\u03c1\u03c4\u03b5\u03c2 \u03b3\u03c1\u03b1\u03bc\u03bc\u03ae\u03c2 \u03b2\u03ac\u03c3\u03b7\u03c2 \u03bc\u03b5 \u03c3\u03c4\u03c1\u03bf\u03b3\u03b3\u03c5\u03bb\u03b5\u03bc\u03ad\u03bd\u03b5\u03c2 \u03b3\u03c9\u03bd\u03af\u03b5\u03c2"},
